import { signup, signin } from '../reducers/userReduser';
import axios from 'axios';
import { PROTOCOL, SERVER_HOST, SERVER_PORT } from '../../config';
import { Dispatch } from '@reduxjs/toolkit';

export const fetchSignUp = (data: object) => {
  return (dispatch: Dispatch): void => {
    const url: string = `${PROTOCOL}://${SERVER_HOST}:${SERVER_PORT}/users/signup`;
    axios.post(url, data, { 
      headers: {
        "Content-Type": "application/json",
        "Access-Control-Allow-Origin": url,
      },
    }).then(response => {
      console.log(response.data)
      dispatch(signup(response));
    });
  }
}

export const fetchSignIn = (data: object) => {
  return (dispatch: Dispatch): void => {
    const url: string = `${PROTOCOL}://${SERVER_HOST}:${SERVER_PORT}/users/signin`;
    axios.post(url, data, { 
      headers: {
        "Content-Type": "application/json",
        "Access-Control-Allow-Origin": url,
      },
    }).then(response => {
      dispatch(signin(response));
    });
  }
}
